import styled from "styled-components";
import { Icon } from "../components";

const UserOverview = () => {
  return (
    <div className="Dash_Overview">
      <span>
        <Heading>Ryan Breaux</Heading>
        <Icon type="soccer" />
      </span>
      <span>
        <Heading>Dani Breaux</Heading>
        <Heading>Zeke Breaux</Heading>
      </span>
    </div>
  );
};

export default User_Overview;
